import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>

      <h1> Register </h1>
      <form>

        <input type="text" name="name" placeholder="Name"/>
        <input type="email" name="name" placeholder="Email"/>
        <input type="password" name="password" placeholder="Password"/>


      </form>


    </div>
  );
}

export default App;
